  const dataRef = useRef();
  const testFunc = () => {
    console.log(dataRef.current.innerText);
  }


  return (
    <div className='github'>
      <div className='call' onClick={testFunc}>div</div>
      <div className='data' ref={dataRef}>value*</div>
      
    </div>
  )
}

export default Github
